import React from 'react';
import { Link } from 'react-router-dom';

const LobbyPage = () => {
  return (
    <div className='flex flex-col gap-2'>
      <h1>Choose Code Block</h1>
      <ul>
        <li><Link to="/codeblock/1">Async case</Link></li>
        <li><Link to="/codeblock/2">Second case</Link></li>
        <li><Link to="/codeblock/3">Third case</Link></li>
        <li><Link to="/codeblock/4">Fourth case</Link></li>
        <li><Link to="/chatgpttest/0">Test Case</Link></li>
        <button><Link to='/'>Test</Link></button>
      </ul>
    </div>
  );
};

export default LobbyPage;
